import logo from "./logo.svg";
import "./App.css";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Employeelist from "./employeelist";

function App() {
  return (
    <div className="App">
      <h1>React js Crud Operation</h1>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Employeelist />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
